                                 Z1, Z2, F@_1, F@_2, F@_3, TrUserData) ->
    d_field_height_res_pb_gateway(Rest,
                                  Z1,
                                  Z2,
                                  F@_1,
                                  F@_2,
                                  F@_3,
                                  TrUserData);
dfp_read_field_def_height_res_pb(<<>>, 0, 0, F@_1, F@_2,
                                 F@_3, _) ->
    S1 = #{height => F@_1, block_age => F@_2},
    if F@_3 == '$undef' -> S1;
       true -> S1#{gateway => F@_3}
    end;
dfp_read_field_def_height_res_pb(Other, Z1, Z2, F@_1,
                                 F@_2, F@_3, TrUserData) ->
    dg_read_field_def_height_res_pb(Other,
                                    Z1,
                                    Z2,
                                    F@_1,
                                    F@_2,
                                    F@_3,
                                    TrUserData).

dg_read_field_def_height_res_pb(<<1:1, X:7,
                                  Rest/binary>>,
                                N, Acc, F@_1, F@_2, F@_3, TrUserData)
    when N < 32 - 7 ->
    dg_read_field_def_height_res_pb(Rest,
                                    N + 7,
                                    X bsl N + Acc,
                                    F@_1,
                                    F@_2,
                                    F@_3,
                                    TrUserData);
dg_read_field_def_height_res_pb(<<0:1, X:7,
                                  Rest/binary>>,
                                N, Acc, F@_1, F@_2, F@_3, TrUserData) ->
    Key = X bsl N + Acc,
    case Key of
        8 ->
            d_field_height_res_pb_height(Rest,
                                         0,
                                         0,
                                         F@_1,
                                         F@_2,
                                         F@_3,
                                         TrUserData);
        16 ->
            d_field_height_res_pb_block_age(Rest,
                                            0,
                                            0,
                                            F@_1,
                                            F@_2,
                                            F@_3,
                                            TrUserData);
        26 ->
            d_field_height_res_pb_gateway(Rest,
                                          0,
                                          0,
                                          F@_1,
                                          F@_2,
                                          F@_3,
                                          TrUserData);
        _ ->
            case Key band 7 of
                0 ->
                    skip_varint_height_res_pb(Rest,
                                              0,
                                              0,
                                              F@_1,
                                              F@_2,
                                              F@_3,
                                              TrUserData);
                1 ->
                    skip_64_height_res_pb(Rest,
                                          0,
                                          0,
                                          F@_1,
                                          F@_2,
                                          F@_3,
                                          TrUserData);
                2 ->
                    skip_length_delimited_height_res_pb(Rest,
                                                        0,
                                                        0,
                                                        F@_1,
                                                        F@_2,
                                                        F@_3,
                                                        TrUserData);
                3 ->
                    skip_group_height_res_pb(Rest,
                                             Key bsr 3,
                                             0,
                                             F@_1,
                                             F@_2,
                                             F@_3,
                                             TrUserData);
                5 ->
                    skip_32_height_res_pb(Rest,
                                          0,
                                          0,
                                          F@_1,
                                          F@_2,
                                          F@_3,
                                          TrUserData)
            end
    end;
dg_read_field_def_height_res_pb(<<>>, 0, 0, F@_1, F@_2,
                                F@_3, _) ->
    S1 = #{height => F@_1, block_age => F@_2},
    if F@_3 == '$undef' -> S1;
       true -> S1#{gateway => F@_3}
    end.

d_field_height_res_pb_height(<<1:1, X:7, Rest/binary>>,
                             N, Acc, F@_1, F@_2, F@_3, TrUserData)
    when N < 57 ->
    d_field_height_res_pb_height(Rest,
                                 N + 7,
                                 X bsl N + Acc,
                                 F@_1,
                                 F@_2,
                                 F@_3,
                                 TrUserData);
d_field_height_res_pb_height(<<0:1, X:7, Rest/binary>>,
                             N, Acc, _, F@_2, F@_3, TrUserData) ->
    {NewFValue, RestF} = {id(X bsl N + Acc, TrUserData),
                          Rest},
    dfp_read_field_def_height_res_pb(RestF,
                                     0,
                                     0,
                                     NewFValue,
                                     F@_2,
                                     F@_3,
                                     TrUserData).

d_field_height_res_pb_block_age(<<1:1, X:7,
                                  Rest/binary>>,
                                N, Acc, F@_1, F@_2, F@_3, TrUserData)
    when N < 57 ->
    d_field_height_res_pb_block_age(Rest,
