                                    F@_3,
                                    TrUserData);
d_field_height_res_pb_block_age(<<0:1, X:7,
                                  Rest/binary>>,
                                N, Acc, F@_1, _, F@_3, TrUserData) ->
    {NewFValue, RestF} = {id(X bsl N + Acc, TrUserData),
                          Rest},
    dfp_read_field_def_height_res_pb(RestF,
                                     0,
                                     0,
                                     F@_1,
                                     NewFValue,
                                     F@_3,
                                     TrUserData).

d_field_height_res_pb_gateway(<<1:1, X:7, Rest/binary>>,
                              N, Acc, F@_1, F@_2, F@_3, TrUserData)
    when N < 57 ->
    d_field_height_res_pb_gateway(Rest,
                                  N + 7,
                                  X bsl N + Acc,
                                  F@_1,
                                  F@_2,
                                  F@_3,
                                  TrUserData);
d_field_height_res_pb_gateway(<<0:1, X:7, Rest/binary>>,
                              N, Acc, F@_1, F@_2, Prev, TrUserData) ->
    {NewFValue, RestF} = begin
                             Len = X bsl N + Acc,
                             <<Bs:Len/binary, Rest2/binary>> = Rest,
                             {id(decode_msg_keyed_uri_pb(Bs, TrUserData),
                                 TrUserData),
                              Rest2}
                         end,
    dfp_read_field_def_height_res_pb(RestF,
                                     0,
                                     0,
                                     F@_1,
                                     F@_2,
                                     if Prev == '$undef' -> NewFValue;
                                        true ->
                                            merge_msg_keyed_uri_pb(Prev,
                                                                   NewFValue,
                                                                   TrUserData)
                                     end,
                                     TrUserData).

skip_varint_height_res_pb(<<1:1, _:7, Rest/binary>>, Z1,
                          Z2, F@_1, F@_2, F@_3, TrUserData) ->
    skip_varint_height_res_pb(Rest,
                              Z1,
                              Z2,
