                                     TrUserData).

skip_group_height_res_pb(Bin, FNum, Z2, F@_1, F@_2,
                         F@_3, TrUserData) ->
    {_, Rest} = read_group(Bin, FNum),
    dfp_read_field_def_height_res_pb(Rest,
                                     0,
                                     Z2,
