                                     TrUserData).

read_group(Bin, FieldNum) ->
    {NumBytes, EndTagLen} = read_gr_b(Bin, 0, 0, 0, 0, FieldNum),
    <<Group:NumBytes/binary, _:EndTagLen/binary, Rest/binary>> = Bin,
    {Group, Rest}.

%% Like skipping over fields, but record the total length,
%% Each field is <(FieldNum bsl 3) bor FieldType> ++ <FieldValue>
%% Record the length because varints may be non-optimally encoded.
%%
%% Groups can be nested, but assume the same FieldNum cannot be nested
%% because group field numbers are shared with the rest of the fields
%% numbers. Thus we can search just for an group-end with the same
%% field number.
%%
%% (The only time the same group field number could occur would
%% be in a nested sub message, but then it would be inside a
%% length-delimited entry, which we skip-read by length.)
read_gr_b(<<1:1, X:7, Tl/binary>>, N, Acc, NumBytes, TagLen, FieldNum)
  when N < (32-7) ->
    read_gr_b(Tl, N+7, X bsl N + Acc, NumBytes, TagLen+1, FieldNum);
read_gr_b(<<0:1, X:7, Tl/binary>>, N, Acc, NumBytes, TagLen,
          FieldNum) ->
    Key = X bsl N + Acc,
    TagLen1 = TagLen + 1,
    case {Key bsr 3, Key band 7} of
        {FieldNum, 4} -> % 4 = group_end
            {NumBytes, TagLen1};
        {_, 0} -> % 0 = varint
            read_gr_vi(Tl, 0, NumBytes + TagLen1, FieldNum);
        {_, 1} -> % 1 = bits64
            <<_:64, Tl2/binary>> = Tl,
            read_gr_b(Tl2, 0, 0, NumBytes + TagLen1 + 8, 0, FieldNum);
        {_, 2} -> % 2 = length_delimited
            read_gr_ld(Tl, 0, 0, NumBytes + TagLen1, FieldNum);
        {_, 3} -> % 3 = group_start
            read_gr_b(Tl, 0, 0, NumBytes + TagLen1, 0, FieldNum);
        {_, 4} -> % 4 = group_end
            read_gr_b(Tl, 0, 0, NumBytes + TagLen1, 0, FieldNum);
        {_, 5} -> % 5 = bits32
            <<_:32, Tl2/binary>> = Tl,
            read_gr_b(Tl2, 0, 0, NumBytes + TagLen1 + 4, 0, FieldNum)
    end.

read_gr_vi(<<1:1, _:7, Tl/binary>>, N, NumBytes, FieldNum)
  when N < (64-7) ->
    read_gr_vi(Tl, N+7, NumBytes+1, FieldNum);
read_gr_vi(<<0:1, _:7, Tl/binary>>, _, NumBytes, FieldNum) ->
    read_gr_b(Tl, 0, 0, NumBytes+1, 0, FieldNum).

read_gr_ld(<<1:1, X:7, Tl/binary>>, N, Acc, NumBytes, FieldNum)
  when N < (64-7) ->
    read_gr_ld(Tl, N+7, X bsl N + Acc, NumBytes+1, FieldNum);
read_gr_ld(<<0:1, X:7, Tl/binary>>, N, Acc, NumBytes, FieldNum) ->
    Len = X bsl N + Acc,
    NumBytes1 = NumBytes + 1,
    <<_:Len/binary, Tl2/binary>> = Tl,
    read_gr_b(Tl2, 0, 0, NumBytes1 + Len, 0, FieldNum).

merge_msgs(Prev, New, MsgName) when is_atom(MsgName) ->
    merge_msgs(Prev, New, MsgName, []).

merge_msgs(Prev, New, MsgName, Opts) ->
    TrUserData = proplists:get_value(user_data, Opts),
    case MsgName of
        pubkey_res_pb ->
            merge_msg_pubkey_res_pb(Prev, New, TrUserData);
        pubkey_req_pb ->
            merge_msg_pubkey_req_pb(Prev, New, TrUserData);
        sign_req_pb ->
            merge_msg_sign_req_pb(Prev, New, TrUserData);
        sign_res_pb ->
            merge_msg_sign_res_pb(Prev, New, TrUserData);
        config_req_pb ->
            merge_msg_config_req_pb(Prev, New, TrUserData);
        config_res_pb ->
            merge_msg_config_res_pb(Prev, New, TrUserData);
        config_value_pb ->
            merge_msg_config_value_pb(Prev, New, TrUserData);
        keyed_uri_pb ->
            merge_msg_keyed_uri_pb(Prev, New, TrUserData);
        height_req_pb ->
            merge_msg_height_req_pb(Prev, New, TrUserData);
        height_res_pb ->
            merge_msg_height_res_pb(Prev, New, TrUserData)
    end.

-compile({nowarn_unused_function,merge_msg_pubkey_res_pb/3}).
merge_msg_pubkey_res_pb(PMsg, NMsg, _) ->
    S1 = #{},
    case {PMsg, NMsg} of
        {_, #{address := NFaddress}} ->
            S1#{address => NFaddress};
        {#{address := PFaddress}, _} ->
            S1#{address => PFaddress};
        _ -> S1
    end.

-compile({nowarn_unused_function,merge_msg_pubkey_req_pb/3}).
merge_msg_pubkey_req_pb(_Prev, New, _TrUserData) -> New.

-compile({nowarn_unused_function,merge_msg_sign_req_pb/3}).
merge_msg_sign_req_pb(PMsg, NMsg, _) ->
    S1 = #{},
    case {PMsg, NMsg} of
        {_, #{data := NFdata}} -> S1#{data => NFdata};
        {#{data := PFdata}, _} -> S1#{data => PFdata};
        _ -> S1
    end.

-compile({nowarn_unused_function,merge_msg_sign_res_pb/3}).
merge_msg_sign_res_pb(PMsg, NMsg, _) ->
    S1 = #{},
    case {PMsg, NMsg} of
        {_, #{signature := NFsignature}} ->
            S1#{signature => NFsignature};
        {#{signature := PFsignature}, _} ->
            S1#{signature => PFsignature};
        _ -> S1
    end.

-compile({nowarn_unused_function,merge_msg_config_req_pb/3}).
merge_msg_config_req_pb(PMsg, NMsg, TrUserData) ->
    S1 = #{},
    case {PMsg, NMsg} of
        {#{keys := PFkeys}, #{keys := NFkeys}} ->
            S1#{keys => 'erlang_++'(PFkeys, NFkeys, TrUserData)};
        {_, #{keys := NFkeys}} -> S1#{keys => NFkeys};
        {#{keys := PFkeys}, _} -> S1#{keys => PFkeys};
        {_, _} -> S1
    end.

-compile({nowarn_unused_function,merge_msg_config_res_pb/3}).
merge_msg_config_res_pb(PMsg, NMsg, TrUserData) ->
    S1 = #{},
    case {PMsg, NMsg} of
        {#{values := PFvalues}, #{values := NFvalues}} ->
            S1#{values =>
                    'erlang_++'(PFvalues, NFvalues, TrUserData)};
        {_, #{values := NFvalues}} -> S1#{values => NFvalues};
        {#{values := PFvalues}, _} -> S1#{values => PFvalues};
        {_, _} -> S1
    end.

-compile({nowarn_unused_function,merge_msg_config_value_pb/3}).
merge_msg_config_value_pb(PMsg, NMsg, _) ->
    S1 = #{},
    S2 = case {PMsg, NMsg} of
             {_, #{name := NFname}} -> S1#{name => NFname};
             {#{name := PFname}, _} -> S1#{name => PFname};
             _ -> S1
         end,
    S3 = case {PMsg, NMsg} of
             {_, #{type := NFtype}} -> S2#{type => NFtype};
             {#{type := PFtype}, _} -> S2#{type => PFtype};
             _ -> S2
         end,
    case {PMsg, NMsg} of
        {_, #{value := NFvalue}} -> S3#{value => NFvalue};
        {#{value := PFvalue}, _} -> S3#{value => PFvalue};
        _ -> S3
    end.

-compile({nowarn_unused_function,merge_msg_keyed_uri_pb/3}).
merge_msg_keyed_uri_pb(PMsg, NMsg, _) ->
    S1 = #{},
    S2 = case {PMsg, NMsg} of
             {_, #{address := NFaddress}} ->
                 S1#{address => NFaddress};
             {#{address := PFaddress}, _} ->
                 S1#{address => PFaddress};
             _ -> S1
         end,
    case {PMsg, NMsg} of
        {_, #{uri := NFuri}} -> S2#{uri => NFuri};
        {#{uri := PFuri}, _} -> S2#{uri => PFuri};
        _ -> S2
    end.

-compile({nowarn_unused_function,merge_msg_height_req_pb/3}).
merge_msg_height_req_pb(_Prev, New, _TrUserData) -> New.

-compile({nowarn_unused_function,merge_msg_height_res_pb/3}).
merge_msg_height_res_pb(PMsg, NMsg, TrUserData) ->
    S1 = #{},
    S2 = case {PMsg, NMsg} of
             {_, #{height := NFheight}} -> S1#{height => NFheight};
             {#{height := PFheight}, _} -> S1#{height => PFheight};
             _ -> S1
         end,
    S3 = case {PMsg, NMsg} of
             {_, #{block_age := NFblock_age}} ->
                 S2#{block_age => NFblock_age};
             {#{block_age := PFblock_age}, _} ->
                 S2#{block_age => PFblock_age};
             _ -> S2
         end,
    case {PMsg, NMsg} of
        {#{gateway := PFgateway}, #{gateway := NFgateway}} ->
            S3#{gateway =>
                    merge_msg_keyed_uri_pb(PFgateway,
                                           NFgateway,
                                           TrUserData)};
        {_, #{gateway := NFgateway}} ->
            S3#{gateway => NFgateway};
        {#{gateway := PFgateway}, _} ->
            S3#{gateway => PFgateway};
        {_, _} -> S3
    end.


verify_msg(Msg, MsgName) when is_atom(MsgName) ->
    verify_msg(Msg, MsgName, []).

verify_msg(Msg, MsgName, Opts) ->
    TrUserData = proplists:get_value(user_data, Opts),
    case MsgName of
        pubkey_res_pb ->
            v_msg_pubkey_res_pb(Msg, [MsgName], TrUserData);
        pubkey_req_pb ->
            v_msg_pubkey_req_pb(Msg, [MsgName], TrUserData);
        sign_req_pb ->
            v_msg_sign_req_pb(Msg, [MsgName], TrUserData);
        sign_res_pb ->
            v_msg_sign_res_pb(Msg, [MsgName], TrUserData);
        config_req_pb ->
            v_msg_config_req_pb(Msg, [MsgName], TrUserData);
        config_res_pb ->
            v_msg_config_res_pb(Msg, [MsgName], TrUserData);
        config_value_pb ->
            v_msg_config_value_pb(Msg, [MsgName], TrUserData);
        keyed_uri_pb ->
            v_msg_keyed_uri_pb(Msg, [MsgName], TrUserData);
        height_req_pb ->
            v_msg_height_req_pb(Msg, [MsgName], TrUserData);
        height_res_pb ->
            v_msg_height_res_pb(Msg, [MsgName], TrUserData);
        _ -> mk_type_error(not_a_known_message, Msg, [])
    end.


-compile({nowarn_unused_function,v_msg_pubkey_res_pb/3}).
-dialyzer({nowarn_function,v_msg_pubkey_res_pb/3}).
v_msg_pubkey_res_pb(#{} = M, Path, TrUserData) ->
    case M of
        #{address := F1} ->
            v_type_bytes(F1, [address | Path], TrUserData);
        _ -> ok
    end,
    lists:foreach(fun (address) -> ok;
                      (OtherKey) ->
                          mk_type_error({extraneous_key, OtherKey}, M, Path)
                  end,
                  maps:keys(M)),
    ok;
v_msg_pubkey_res_pb(M, Path, _TrUserData)
    when is_map(M) ->
    mk_type_error({missing_fields,
                   [] -- maps:keys(M),
                   pubkey_res_pb},
                  M,
                  Path);
v_msg_pubkey_res_pb(X, Path, _TrUserData) ->
    mk_type_error({expected_msg, pubkey_res_pb}, X, Path).

