-compile({nowarn_unused_function,v_msg_config_req_pb/3}).
-dialyzer({nowarn_function,v_msg_config_req_pb/3}).
v_msg_config_req_pb(#{} = M, Path, TrUserData) ->
    case M of
        #{keys := F1} ->
            if is_list(F1) ->
                   _ = [v_type_string(Elem, [keys | Path], TrUserData)
                        || Elem <- F1],
                   ok;
               true ->
                   mk_type_error({invalid_list_of, string},
                                 F1,
                                 [keys | Path])
            end;
        _ -> ok
    end,
    lists:foreach(fun (keys) -> ok;
                      (OtherKey) ->
                          mk_type_error({extraneous_key, OtherKey}, M, Path)
                  end,
                  maps:keys(M)),
    ok;
v_msg_config_req_pb(M, Path, _TrUserData)
    when is_map(M) ->
    mk_type_error({missing_fields,
                   [] -- maps:keys(M),
                   config_req_pb},
                  M,
