-compile({nowarn_unused_function,v_msg_config_res_pb/3}).
-dialyzer({nowarn_function,v_msg_config_res_pb/3}).
v_msg_config_res_pb(#{} = M, Path, TrUserData) ->
    case M of
        #{values := F1} ->
            if is_list(F1) ->
                   _ = [v_msg_config_value_pb(Elem,
                                              [values | Path],
                                              TrUserData)
                        || Elem <- F1],
                   ok;
               true ->
                   mk_type_error({invalid_list_of, {msg, config_value_pb}},
                                 F1,
                                 [values | Path])
            end;
        _ -> ok
    end,
    lists:foreach(fun (values) -> ok;
                      (OtherKey) ->
                          mk_type_error({extraneous_key, OtherKey}, M, Path)
                  end,
                  maps:keys(M)),
    ok;
v_msg_config_res_pb(M, Path, _TrUserData)
    when is_map(M) ->
    mk_type_error({missing_fields,
                   [] -- maps:keys(M),
                   config_res_pb},
                  M,
                  Path);
v_msg_config_res_pb(X, Path, _TrUserData) ->
    mk_type_error({expected_msg, config_res_pb}, X, Path).

-compile({nowarn_unused_function,v_msg_config_value_pb/3}).
-dialyzer({nowarn_function,v_msg_config_value_pb/3}).
v_msg_config_value_pb(#{} = M, Path, TrUserData) ->
    case M of
        #{name := F1} ->
            v_type_string(F1, [name | Path], TrUserData);
        _ -> ok
    end,
    case M of
        #{type := F2} ->
            v_type_string(F2, [type | Path], TrUserData);
        _ -> ok
    end,
    case M of
        #{value := F3} ->
            v_type_bytes(F3, [value | Path], TrUserData);
        _ -> ok
    end,
    lists:foreach(fun (name) -> ok;
                      (type) -> ok;
                      (value) -> ok;
                      (OtherKey) ->
                          mk_type_error({extraneous_key, OtherKey}, M, Path)
                  end,
                  maps:keys(M)),
    ok;
v_msg_config_value_pb(M, Path, _TrUserData)
    when is_map(M) ->
    mk_type_error({missing_fields,
                   [] -- maps:keys(M),
                   config_value_pb},
