v_msg_config_value_pb(X, Path, _TrUserData) ->
    mk_type_error({expected_msg, config_value_pb}, X, Path).

-compile({nowarn_unused_function,v_msg_keyed_uri_pb/3}).
-dialyzer({nowarn_function,v_msg_keyed_uri_pb/3}).
