-compile({nowarn_unused_function,v_msg_height_res_pb/3}).
-dialyzer({nowarn_function,v_msg_height_res_pb/3}).
v_msg_height_res_pb(#{} = M, Path, TrUserData) ->
    case M of
        #{height := F1} ->
            v_type_uint64(F1, [height | Path], TrUserData);
        _ -> ok
    end,
    case M of
        #{block_age := F2} ->
            v_type_uint64(F2, [block_age | Path], TrUserData);
        _ -> ok
    end,
    case M of
        #{gateway := F3} ->
            v_msg_keyed_uri_pb(F3, [gateway | Path], TrUserData);
        _ -> ok
    end,
    lists:foreach(fun (height) -> ok;
                      (block_age) -> ok;
                      (gateway) -> ok;
